import { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

import PieceOfArt from './PieceOfArt.js'

//Query the Rijks museum API


function App() {
  const [art, setArt] = useState([]);


  // then((data) => data.data.artObjects.forEach(value => console.log(value.webImage.url)


  useEffect(() => {
    axios({
      url: 'https://www.rijksmuseum.nl/api/en/collection',
      method: 'GET',
      dataResponse: 'json',
      params: {
        key: 'pZXAax4n',
        format: 'json',
        imgonly: true
      }

    }).then((response) => {
      setArt(response.data.artObjects)

    });
  }, []);

  console.log(art);

  return (
    <div className="App">
      <h1>My Museum Art!</h1>

      {
        art.map(value => {
          return (
            <PieceOfArt
              imgPath={value.webImage.url} title={value.title} />)
        })
      }
    </div>
  );
}

export default App;
